import React from 'react';
import { useNavigate } from 'react-router-dom';

function HomePage() {
  const navigate = useNavigate();

  return (
    <div
      className="flex flex-col items-center justify-center p-6 min-h-screen w-full h-full bg-cover bg-center bg-no-repeat"
      style={{
        minHeight: '100vh',
        minWidth: '100vw',
      }}
    >
      <h2 className="text-4xl font-bold mb-6 text-blue-600">Welcome to Resume Editor</h2>
      <p className="mt-4 text-lg text-gray-700 max-w-xl text-center">
        Click on any section in the navigation bar to edit your resume in a more attractive and effective manner.
      </p>
    </div>
  );
}

export default HomePage;
